    border-radius: 50%;

    height: 40px; /* Smaller height */

}
.spinner {
  border: 8px solid #178287;
  border-top: 10px solid #345688;
  border-radius: 50%;
  width: 80px;
  height: 80px;
  animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}

#loading-screen p {
    margin-top: 10px; /* Adjust margin if necessary */
    font-size: 18px;
    color: #333;
}
</style>
